int AutoTrans_PrefStore_tr_SetStringVal(TransactionReturnVal *pReturnVal, GlobalType eServerTypeToRunOn, GlobalType pStore_type, U32 pStore_ID, const char *key, const char *val)
{
	char *pATRString = NULL;
	int iRetVal;
	ContainerID iServerIDToRunOn;	
PERFINFO_AUTO_START_FUNC();
	estrStackCreate(&pATRString);
	if (eServerTypeToRunOn == GetAppGlobalType()) iServerIDToRunOn = GetAppGlobalID(); else iServerIDToRunOn = SPECIAL_CONTAINERID_FIND_BEST_FOR_TRANSACTION;
	estrConcatf(&pATRString, "PrefStore_tr_SetStringVal ");
	devassert(pStore_type == GLOBALTYPE_NONE || GlobalTypeSchemaType(pStore_type) == SCHEMATYPE_PERSISTED);
	if (pStore_ID == 0)
		estrConcatf(&pATRString, "NULL ");
	else
		estrConcatf(&pATRString, "%s[%u] ", GlobalTypeToName(pStore_type), pStore_ID);
	estrConcatf(&pATRString, "\"");
	estrAppendEscaped(&pATRString, key);
	estrConcatf(&pATRString, "\" ");
	estrConcatf(&pATRString, "\"");
	estrAppendEscaped(&pATRString, val);
	estrConcatf(&pATRString, "\" ");

	if (isDevelopmentMode()) AutoTrans_VerifyReturnLoggingCompatibility("PrefStore_tr_SetStringVal", eServerTypeToRunOn, pReturnVal);

	iRetVal = objRequestAutoTransaction(NULL, pReturnVal, eServerTypeToRunOn, iServerIDToRunOn, pATRString);
	estrDestroy(&pATRString);
	PERFINFO_AUTO_STOP_FUNC();
	return iRetVal;
}
